import React from "react";
import Clock from "react-live-clock";
export const clock = () => {
  return (
    <div className="clock">
      <Clock className="clockCustom" format={"HH:MM"} ticking={true} timezone={"Asia/Seoul"}></Clock>
    </div>
  );
};

export default clock;
